BEGIN
	DECLARE vGENERAL_DUE INT;
    DECLARE vGENERAL BOOLEAN;
	DECLARE vAUTO_DUE INT;
	DECLARE vCARGO_DUE INT;
    DECLARE vRESPONSE varchar(10);
    DECLARE vOVERRIDE VARCHAR(10);

 	select COALESCE(THE_VALUE, 'false') INTO vOVERRIDE
	from EXP_SETTING 
	where CATEGORY = 'option' AND SETTING = 'OVERRIDE_CARRIER_EXPIRY';

	select LIABILITY_DATE IS NOT NULL,
    DATEDIFF(coalesce(LIABILITY_DATE, CURRENT_DATE), CURRENT_DATE) GENERAL_DUE,
    DATEDIFF(coalesce(AUTO_LIAB_DATE, CURRENT_DATE), CURRENT_DATE) AUTO_DUE,
    DATEDIFF(coalesce(CARGO_LIAB_DATE, CURRENT_DATE), CURRENT_DATE) CARGO_DUE
	INTO vGENERAL, vGENERAL_DUE, vAUTO_DUE, vCARGO_DUE
	from EXP_CARRIER
	where CARRIER_CODE = CARRIER_IN;

    IF vOVERRIDE = 'true' THEN
		SET vRESPONSE = 'green';
    ELSEIF (vGENERAL AND vGENERAL_DUE <= 0) OR vAUTO_DUE <= 0 OR vCARGO_DUE <= 0 THEN
		SET vRESPONSE = 'red';
	ELSEIF (vGENERAL AND vGENERAL_DUE <= 15) OR vAUTO_DUE <= 15 OR vCARGO_DUE <= 15 THEN
		SET vRESPONSE = 'orange';
	ELSEIF (vGENERAL AND vGENERAL_DUE <= 30) OR vAUTO_DUE <= 30 OR vCARGO_DUE <= 30 THEN
		SET vRESPONSE = 'yellow';
	ELSE
		SET vRESPONSE = 'green';
    END IF;

RETURN vRESPONSE;
END

BEGIN
	DECLARE vGENERAL_LIAB_INS int;
	DECLARE vAUTO_LIAB_INS int;
	DECLARE vCARGO_LIAB_INS int;
 	DECLARE vGENERAL_DAYS int;
	DECLARE vAUTO_DAYS int;
	DECLARE vCARGO_DAYS int;
	DECLARE vRESPONSE BOOLEAN;
    DECLARE vMUST_CHECK VARCHAR(10);
    DECLARE vCURRENCY_CODE enum('USD','CAD');
    DECLARE vFAILING_SHIPMENTS int;

 	select COALESCE(THE_VALUE, 'false') INTO vMUST_CHECK
	from EXP_SETTING 
	where CATEGORY = 'option' AND SETTING = 'CARRIER_INSUFFCIENT_INS';

    IF vMUST_CHECK = 'false' THEN
		SET vRESPONSE = true;
    ELSE
		-- Get data from the carrier
		SELECT COALESCE(c.GENERAL_LIAB_INS, 0) GENERAL_LIAB_INS,
		COALESCE(c.AUTO_LIAB_INS, 0) AUTO_LIAB_INS,
		COALESCE(c.CARGO_LIAB_INS, 0) CARGO_LIAB_INS,
		COALESCE(DATEDIFF(LIABILITY_DATE, CURRENT_DATE), 0) GENERAL_DAYS,
		COALESCE(DATEDIFF(AUTO_LIAB_DATE, CURRENT_DATE), 0) AUTO_DAYS,
		COALESCE(DATEDIFF(CARGO_LIAB_DATE, CURRENT_DATE), 0) CARGO_DAYS,
		CURRENCY_CODE
        INTO vGENERAL_LIAB_INS, vAUTO_LIAB_INS, vCARGO_LIAB_INS,
			vGENERAL_DAYS, vAUTO_DAYS, vCARGO_DAYS,
            vCURRENCY_CODE       
		FROM EXP_CARRIER c
		WHERE c.CARRIER_CODE = CARRIER_IN;

		-- Check required insurance

		SELECT COUNT(*) INTO vFAILING_SHIPMENTS

		FROM EXP_LOAD l, EXP_SHIPMENT s, EXP_CLIENT c
		WHERE l.LOAD_CODE = LOAD_IN
		AND l.LOAD_CODE = s.LOAD_CODE
		AND s.BILLTO_CLIENT_CODE = c.CLIENT_CODE
		AND (
			vGENERAL_LIAB_INS < COALESCE(c.GENERAL_LIAB_INS,0) *
				CONVERT_RATE( get_asof(s.SHIPMENT_CODE), c.CURRENCY_CODE, vCURRENCY_CODE)

			OR vAUTO_LIAB_INS < COALESCE(c.AUTO_LIAB_INS,0) *
				CONVERT_RATE( get_asof(s.SHIPMENT_CODE), c.CURRENCY_CODE, vCURRENCY_CODE)

			OR vCARGO_LIAB_INS < COALESCE(c.CARGO_LIAB_INS,0) *
				CONVERT_RATE( get_asof(s.SHIPMENT_CODE), c.CURRENCY_CODE, vCURRENCY_CODE)

			OR COALESCE(c.GENERAL_LIAB_INS,0) > 0 AND vGENERAL_DAYS <= 0
			OR COALESCE(c.AUTO_LIAB_INS,0) > 0 AND vAUTO_DAYS <= 0
			OR COALESCE(c.CARGO_LIAB_INS,0) > 0 AND vCARGO_DAYS <= 0
		);

        -- If any fail then return false
        IF vFAILING_SHIPMENTS > 0 THEN
			SET vRESPONSE = false;
		ELSE
			SET vRESPONSE = true;
		END IF;

    END IF;

RETURN vRESPONSE;
END

BEGIN
	DECLARE vRESPONSE BOOLEAN;
    DECLARE vMUST_CHECK VARCHAR(10);
    DECLARE vCURRENCY_CODE enum('USD','CAD');

 	select COALESCE(THE_VALUE, 'false') INTO vMUST_CHECK
	from EXP_SETTING 
	where CATEGORY = 'option' AND SETTING = 'CARRIER_INSUFFCIENT_INS';

    IF vMUST_CHECK = 'false' THEN
		SET vRESPONSE = true;
    ELSE
		set vCURRENCY_CODE = home_currency();

        -- Get data from the carrier
		SELECT COUNT(*) > 0 INTO vRESPONSE

		FROM EXP_CARRIER c
		WHERE c.CARRIER_CODE = CARRIER_IN
        AND COALESCE(c.GENERAL_LIAB_INS,0) *
				CONVERT_RATE( ASOF_IN, c.CURRENCY_CODE, vCURRENCY_CODE) >= GENERAL_LIAB_INS_IN
		AND COALESCE(c.AUTO_LIAB_INS,0) *
				CONVERT_RATE( ASOF_IN, c.CURRENCY_CODE, vCURRENCY_CODE) >= AUTO_LIAB_INS_IN
		AND COALESCE(c.CARGO_LIAB_INS,0) *
				CONVERT_RATE( ASOF_IN, c.CURRENCY_CODE, vCURRENCY_CODE) >= CARGO_LIAB_INS_IN
        AND (GENERAL_LIAB_INS_IN <= 0 OR 
			COALESCE(DATEDIFF(LIABILITY_DATE, CURRENT_DATE), 0) > 0)    
         AND (AUTO_LIAB_INS_IN <= 0 OR 
			COALESCE(DATEDIFF(AUTO_LIAB_DATE, CURRENT_DATE), 0) > 0)    
        AND (CARGO_LIAB_INS_IN <= 0 OR 
			COALESCE(DATEDIFF(CARGO_LIAB_DATE, CURRENT_DATE), 0) > 0);

    END IF;

RETURN vRESPONSE;
END

