BEGIN
	DECLARE vASOF DATE;
    DECLARE vAMOUNT_OUT DOUBLE;
    DECLARE vRATE DOUBLE;
    DECLARE vSHIPMENT_CURRENCY VARCHAR(3)  CHARSET utf8;
    DECLARE vHOME_CURRENCY VARCHAR(3)  CHARSET utf8;

    SET vASOF = GET_ASOF( SHIPMENT_IN );

 	set vHOME_CURRENCY = SHIPMENT_HOME_CURRENCY( SHIPMENT_IN );

	SELECT CURRENCY
    INTO vSHIPMENT_CURRENCY
	FROM EXP_CLIENT_BILLING
	WHERE SHIPMENT_ID = SHIPMENT_IN;

    SET vSHIPMENT_CURRENCY = COALESCE(vSHIPMENT_CURRENCY, vHOME_CURRENCY);

    IF vSHIPMENT_CURRENCY = DEST_CURRENCY OR AMOUNT_IN = 0 THEN
		SET vAMOUNT_OUT = AMOUNT_IN;

	ELSEIF vSHIPMENT_CURRENCY = vHOME_CURRENCY THEN
		SET vRATE = CONVERT_RATE(vASOF, vHOME_CURRENCY, DEST_CURRENCY);

        IF vRATE IS NOT NULL THEN
			SET vAMOUNT_OUT = ROUND(AMOUNT_IN * vRATE, 2);
		ELSE
			SET vAMOUNT_OUT = -1;
		END IF;

 	ELSEIF DEST_CURRENCY = vHOME_CURRENCY THEN
		SET vRATE = CONVERT_RATE(vASOF, vHOME_CURRENCY, vSHIPMENT_CURRENCY);

        IF vRATE IS NOT NULL THEN
			SET vAMOUNT_OUT = ROUND(AMOUNT_IN / vRATE, 2);
		ELSE
			SET vAMOUNT_OUT = -2;
		END IF;
	ELSE
		SET vAMOUNT_OUT = 0;
    END IF;

RETURN vAMOUNT_OUT;
END

BEGIN
	DECLARE vASOF DATE;
