    DECLARE vRATE DOUBLE;
    DECLARE vLOAD_CURRENCY VARCHAR(3);
    DECLARE vHOME_CURRENCY VARCHAR(3);

    SET vASOF = GET_LOAD_ASOF( LOAD_IN );

    SELECT CURRENCY,
    (select COALESCE(C.HOME_CURRENCY, 'USD')
        FROM EXP_COMPANY C, EXP_OFFICE O
        WHERE EXP_LOAD.OFFICE_CODE = O.OFFICE_CODE
		AND O.COMPANY_CODE = C.COMPANY_CODE) AS HOME_CURRENCY
    INTO vLOAD_CURRENCY, vHOME_CURRENCY
    FROM EXP_LOAD
    WHERE LOAD_CODE = LOAD_IN;

    SET vRATE = CONVERT_RATE(vASOF, vLOAD_CURRENCY, vHOME_CURRENCY);

	IF vRATE IS NOT NULL THEN
		SET vAMOUNT_OUT = ROUND(AMOUNT_IN * vRATE, 2);
	ELSE
		SET vAMOUNT_OUT = -1;
	END IF;

RETURN vAMOUNT_OUT;
END

BEGIN
     DECLARE vRATE DOUBLE;
     DECLARE vASOF DATE;
     DECLARE vMULTI_CURRENCY VARCHAR(10);
  	select COALESCE(THE_VALUE, 'false') INTO vMULTI_CURRENCY
 	from EXP_SETTING
 	where CATEGORY = 'option' AND SETTING = 'MULTI_CURRENCY';
     IF( FROM_CURRENCY_IN = TO_CURRENCY_IN OR vMULTI_CURRENCY != 'true' ) THEN
 		SET vRATE = 1.0000;
 	ELSE
 		SELECT ASOF, COALESCE(EXCHANGE_RATE,0)
 		INTO vASOF, vRATE
 		FROM EXP_EXCHANGE
 		WHERE FROM_CURRENCY = FROM_CURRENCY_IN
 		AND TO_CURRENCY = TO_CURRENCY_IN
 		AND ASOF BETWEEN DATE_SUB(ASOF_IN, INTERVAL 90 DAY) AND ASOF_IN
         ORDER BY ASOF DESC
 		LIMIT 1;
 		IF vRATE IS NULL THEN
 			SELECT ASOF, COALESCE(ROUND(1 / EXCHANGE_RATE, 4),0)
 			INTO vASOF, vRATE
 			FROM EXP_EXCHANGE
 			WHERE FROM_CURRENCY = TO_CURRENCY_IN
 			AND TO_CURRENCY = FROM_CURRENCY_IN
 			AND ASOF BETWEEN DATE_SUB(ASOF_IN, INTERVAL 90 DAY) AND ASOF_IN
 			ORDER BY ASOF DESC
 			LIMIT 1;
 		END IF;
 	END IF;
 RETURN vRATE;
 END

