BEGIN
	DECLARE vPHYSICAL_DUE INT;
	DECLARE vLICENSE_DUE INT;
	DECLARE vRANDOM BOOLEAN;
	DECLARE vRANDOM_DUE INT;
    DECLARE vRESPONSE varchar(10);

	select DATEDIFF(coalesce(PHYSICAL_DUE, CURRENT_DATE), CURRENT_DATE) PHYSICAL_DUE,
    DRIVER_RANDOM IS NOT NULL,
    DATEDIFF(coalesce(DRIVER_RANDOM, CURRENT_DATE ), CURRENT_DATE) RANDOM_DUE,
	DATEDIFF(COALESCE((SELECT MAX(LICENSE_EXPIRY_DATE)
			FROM EXP_LICENSE
			WHERE CONTACT_CODE = DRIVER_CODE
			AND CONTACT_SOURCE = 'driver'), CURRENT_DATE), CURRENT_DATE) LICENSE_DUE
	INTO vPHYSICAL_DUE, vRANDOM, vRANDOM_DUE, vLICENSE_DUE
	from exp_driver
	where DRIVER_CODE = DRIVER_IN;

    IF NOT SHOW_RANDOM THEN
		SET vRANDOM = FALSE;
	END IF;

    IF vPHYSICAL_DUE <= 0 OR vLICENSE_DUE <= 0 OR (vRANDOM AND vRANDOM_DUE < 0) THEN
		SET vRESPONSE = 'red';
	ELSEIF vPHYSICAL_DUE < 15 OR vLICENSE_DUE < 15 OR (vRANDOM AND vRANDOM_DUE < 15) THEN
		SET vRESPONSE = 'orange';
	ELSEIF vPHYSICAL_DUE < 30 OR vLICENSE_DUE < 30 OR vRANDOM THEN
		SET vRESPONSE = 'yellow';
	ELSE
		SET vRESPONSE = 'green';
    END IF;

RETURN vRESPONSE;
END

BEGIN
	DECLARE vDUE TIMESTAMP;
    DECLARE vRESULT varchar(10) CHARSET utf8;
    DECLARE vNOW TIMESTAMP;

	SET session time_zone = 'SYSTEM'; 

	IF TIME_OPTION_IN IN ('ASAP', 'FCFS') THEN
		SET vDUE = TIMESTAMP(COALESCE(DATE_IN, NOW()), '23:59');
	ELSEIF TIME_OPTION_IN = 'Between' THEN
		IF COALESCE(TIME2_IN, '') = '' then 
			SET vDUE = TIMESTAMP(COALESCE(DATE_IN, NOW()), '00:00');
		ELSE
			SET vDUE = TIMESTAMP(COALESCE(DATE_IN, NOW()), concat_ws(':', substr(TIME2_IN, 1, 2), substr(TIME2_IN, 3, 2)));
		END IF;
	ELSEIF coalesce(TIME1_IN, '') = '' then 
		SET vDUE = TIMESTAMP(COALESCE(DATE_IN, NOW()), '00:00');
	ELSE
		SET vDUE = TIMESTAMP(COALESCE(DATE_IN, NOW()), concat_ws(':', substr(TIME1_IN, 1, 2), substr(TIME1_IN, 3, 2)));
	END IF;

    SET vNOW = NOW_TIMEZONE(ZIP_IN);

    IF vNOW > vDUE THEN
		SET vRESULT = 'red';
	ELSEIF vNOW > DATE_SUB(vDUE, INTERVAL 30 MINUTE) THEN
		SET vRESULT = 'pink';
 	ELSEIF vNOW > DATE_SUB(vDUE, INTERVAL 60 MINUTE) THEN
		SET vRESULT = 'purple';
   ELSE
		SET vRESULT = 'black';
	END IF;

RETURN vRESULT;
END

