BEGIN
	DECLARE vZONE VARCHAR(10);
    DECLARE vZIP VARCHAR(10);

    IF LENGTH(ZIP_IN) = 10 AND LOCATE('-', ZIP_IN) = 6 THEN
		SET vZIP = LEFT(ZIP_IN, 5);
	ELSE
		SET vZIP = ZIP_IN;
    END IF;

	select COALESCE( exp_timezone.name, 'Unknown TZ')
    INTO vZONE
    from (
	select Time_Zone from canada_post_codes
	where PostalCode = ZIP_IN
	union all 
	select TimeZone as Time_Zone from zipcodes
	where ZipCode = vZIP
    limit 1) x, exp_timezone
    where exp_timezone.zone_offset = Time_Zone;

RETURN vZONE;
END

