BEGIN
 	DECLARE VUSER int;
 	DECLARE VMGR int;

    SET VUSER = USER_IN;

	WHILE VUSER > 0 DO
		SELECT COALESCE(MANAGER, 0)
		INTO VMGR
		FROM EXP_USER
		WHERE USER_CODE = VUSER;

        IF VMGR = MANAGER_IN THEN
			RETURN TRUE;
		ELSEIF VMGR = 0 THEN
			RETURN FALSE;
		ELSE
			SET VUSER = VMGR;
		END IF;

    END WHILE;

	RETURN FALSE;
END

