BEGIN
	DECLARE S, S1 INT;
	DECLARE A, L, A1, L1 VARCHAR(512);
	DECLARE OUT_STRING VARCHAR(2048);
    DECLARE done INT DEFAULT FALSE;

    -- Get a list of city/state for all stops

	DECLARE cur1 CURSOR FOR SELECT SEQUENCE_NO,
		(CASE WHEN STOP_TYPE = 'pick' THEN SHIPPER_ADDR1
		WHEN STOP_TYPE = 'drop' THEN CONS_ADDR1
		ELSE stop_addr1 END ) AS ADDR1,
		concat((CASE WHEN STOP_TYPE = 'pick' THEN SHIPPER_CITY
		WHEN STOP_TYPE = 'drop' THEN CONS_CITY
		ELSE stop_city END ), ', ',
		(CASE WHEN STOP_TYPE = 'pick' THEN SHIPPER_STATE
		WHEN STOP_TYPE = 'drop' THEN CONS_STATE
		ELSE STOP_STATE END )) AS LOCATION

		FROM EXP_STOP 
		LEFT JOIN EXP_SHIPMENT
		ON EXP_SHIPMENT.SHIPMENT_CODE = EXP_STOP.SHIPMENT
		WHERE EXP_STOP.LOAD_CODE = LOAD_IN
		ORDER BY SEQUENCE_NO ASC;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

	SET OUT_STRING = '';

    -- turn it into html with <br> to separate lines.
    -- avoid duplicates (same location, adjacent stops)

	OPEN cur1;
	read_loop: LOOP
    	FETCH cur1 INTO S, A, L;
    	IF done THEN
    		LEAVE read_loop;
    	END IF;
    	IF S = 1 THEN
			SET S1 = S, A1 = A, L1 = L;
    		ITERATE read_loop;
    	ELSEIF A1 = A AND L1 = L THEN
        	SET S1 = S;
    		ITERATE read_loop;
		END IF;
		IF OUT_STRING != '' THEN
			SET OUT_STRING = CONCAT(OUT_STRING, '<br>');
		END IF;
		SET OUT_STRING = CONCAT(OUT_STRING, L1, ' --> ', L);
        SET S1 = S, A1 = A, L1 = L;
	END LOOP read_loop;

    CLOSE cur1;

	RETURN OUT_STRING;
END

BEGIN
