 	declare ZONE_RESULT BOOL;
 	-- Get state
 	select State
 	into MATCH_STATE
 	FROM zipcodes
 	WHERE ZipCode = MATCH_ZIP
 	AND PrimaryRecord = 'P'
 	LIMIT 0, 1;
 	-- Get prefix
 	SET MATCH_PREFIX = substring(MATCH_ZIP, 1,3);
 	-- Search zone filters
 	SELECT if(count(*)>0,true,false) NUM
 	into ZONE_RESULT
 	FROM EXP_ZONE_FILTER
 	WHERE ZF_NAME = ZONE
 	AND ((ZF_TYPE = 'State' AND ZF_VALUE = MATCH_STATE)
 			OR (ZF_TYPE = 'Prefix' AND ZF_VALUE = MATCH_PREFIX)
 			OR (ZF_TYPE = 'ZIP Code' AND ZF_VALUE = MATCH_ZIP));
 	return ZONE_RESULT OR MATCH_ZIP = ZONE;
 END

